import react from 'react'
import Emojidata from './Emojidata'
let carrierObj={
border:"3px solid rgba(238, 28, 28, 0.897)",
height:"449px",
width:"500px",
display:"flex",
justifyContent:"space-evenly"
}
let boxObj={
    height:"445px",
    width:"95px",
    overflowY:"scroll",
    backgroundColor:"rgb(240, 105, 105)"
}
const Emgcarrier=()=>{
    document.getElementById('d1').addEventListener("scroll",()=>{
        var x =this.scrollX;
        var y=this.scrollY;
        console.log(x+" "+y)
    })
    return(
        <>
    <div id="d1" style={boxObj}>
        {
        Emojidata.map((val)=>{
          return(
              <>
              <span style={{fontSize:"40px",paddingLeft:"21px"}}>{val}</span>
              </>
          )
        })
        }
    </div>
    </>
    )
}
const Gameplay=(props)=>{
    if(props.gameStart==true)
    {
        var i=0;
        while(i<=5){
        console.log("Hi");
        i++;
        }
    }
return(
<>
<div id="carrier" style={carrierObj}>
<Emgcarrier/>
<Emgcarrier/>
<Emgcarrier/>
</div>
</>
)
}
export default Gameplay
